import React from "react";
import {
    withGoogleMap,
    withScriptjs,
    useLoadScript,
    GoogleMap,
    Marker,
    InfoWindow
} from "react-google-maps";
import Navbar from "../components/Navbar";
import logo from '../icons/Home.png';
import './priceComparison.css';
import * as propertyData from "../components/skateboard-parks.json";
import Background from '../icons/background.png';

var backgroundStyle = {
    backgroundSize: 'cover',
    height: '100vh',
    backgroundRepeat: 'no-repeat',
    opacity: '0.3',
    backgroundImage: `url(${Background})`
};
var logoStyle = {
    width: "160px",
    height: "160px",
    backgroundRepeat: 'no-repeat'
};

class HomePage extends React.Component {
    constructor(props) {
        super(props);
        this.state = { pc: [] };
    }


    render() {

        return (
            <>
                <div className="home" style={backgroundStyle}></div>
                <div className="title-name">
                    <img className="homepage-logo" src={logo} style={logoStyle} alt="Logo" />
                    <h4 className="name">AusNewRenters</h4>
                </div>




            </>

        );
    }
}





export default HomePage;
